import React from "react";
import { BrowserRouter as Router } from 'react-router-dom';
import { Nav, NavDropdown } from 'react-bootstrap'

import "../navigation/navigation.css";

class CommunicatorNavigation extends React.Component {
  render() {
    return (
        <Router>
        <Nav id="navigation" as="ul" className="navbar navbar-inverse menu-background sht-navbar">
            <Dropdown as={NavItem}>
            <Dropdown.Toggle as={NavLink}>Click to see moreâ€¦</Dropdown.Toggle>
            <Dropdown.Menu>
            <Dropdown.Item>Hello there!</Dropdown.Item>
            </Dropdown.Menu>
            </Dropdown>
        </Nav>
        </Router>
    )
  }
} 

export default CommunicatorNavigation;
